import React from "react";
import "./Overview.css";

export default function Overview() {
    return <div>
        <h1>OVERVIEW</h1>
        <p>I'm a software engineer with experience in both Backend and Frontend. My passion lies in leveraging technology to tackle complex business challenges.</p>
    </div>
}

